<template>
  <page-layout :avatar="currUser.avatar">
    <a-card :bordered="false" style="width: 100%">
      <div>
        <a-select style="width: 120px" @change="handleProvinceChange">
          <a-select-option
            v-for="province in provinceData"
            :key="province.value"
          >
            {{ province.name }}
          </a-select-option>
        </a-select>
        <a-select
          v-model="secondCity"
          style="width: 120px"
          @change="floorChange"
        >
          <a-select-option v-for="city in cities" :key="city.value">
            {{ city.name }}
          </a-select-option>
        </a-select>
        <a-button type="primary" @click="doSearch"> 查看 </a-button>

        <a-select
          default-value="灭火器"
          style="width: 120px; margin-left: 30px"
          @change="handleChange"
        >
          <a-select-option value="灭火器"> 灭火器 </a-select-option>
          <a-select-option value="报警按钮"> 报警按钮 </a-select-option>
          <a-select-option value="电闸"> 电闸 </a-select-option>
          <a-select-option value="消防栓"> 消防栓 </a-select-option>
          <a-select-option value="应急灯"> 应急灯 </a-select-option>
        </a-select>
        <span>X:</span
        ><a-input-number
          id="inputNumber"
          v-model="mapX"
          :min="1"
          :max="100000"
        />
        <span>Y:</span
        ><a-input-number
          id="inputNumber"
          v-model="mapY"
          :min="1"
          :max="100000"
        />
        <a-button type="primary" @click="doAdd"> 添加 </a-button>
      </div>
    </a-card>
    <div
      ref="myChart"
      id="myChart"
      :style="{ width: '1616px', height: '500px' }"
    ></div>
  </page-layout>
</template>

<script>
import PageLayout from "@/layouts/PageLayout";
import { mapState } from "vuex";
import { request, METHOD } from "@/utils/request";
import { getMapData, object, getBuildData } from "@/services/dataSource";

export default {
  name: "WorkPlace",
  components: { PageLayout },
  i18n: require("./i18n"),
  data() {
    return {
      projects: [],
      loading: true,
      activities: [],
      teams: [],
      welcome: {
        timeFix: "",
        message: "",
      },
      provinceData: [],
      cityData: {},
      cities: [],
      secondCity: [],
      buildname: "一号楼",
      floorname: "一层",
      autoKey: 1,
      currentKey: undefined,
      currentValue: undefined,
      modalVisible: false,
      firstData: [{ key: 0, name: "请选择" }],
      testMapImage: "",
