  computed: {
    ...mapState("account", { currUser: "user" }),
    ...mapState("setting", ["lang"]),
  },
  created() {
    request("/user/welcome", METHOD.GET).then(
      (res) => (this.welcome = res.data)
    );
  },
  mounted() {
    getBuildData().then((result) => {
      this.provinceData = result.data.data.blocks;
      this.cityData = result.data.data.floors;
    });
    this.getMap({
      // blockId: "123",
      floorId: "1",
    });
  },
  methods: {
    handleProvinceChange(value) {
      this.cities = this.cityData[value];
      this.secondCity = "";
      this.floorname = "";
      for (let i in this.provinceData) {
        if (this.provinceData[i].value == value) {
          this.block_name = this.provinceData[i].name;
        }
      }
      this.buildname = value;
    },
    floorChange(value) {
      for (let i in this.cityData[this.buildname]) {
        if (this.cityData[this.buildname][i].value == value) {
          this.floor_name = this.cityData[this.buildname][i].name;
        }
      }
      this.floorname = value;
    },
    doSearch() {
      this.getMap({
        // blockId: this.buildname,
        floorId: this.floorname,
      });
    },
    getMap(params) {
      getMapData(params).then((result) => {
        var mapImage = "";
        this.testMapImage = this.map;
        this.student = result.data.data.student;
        console.log(result);
        this.room = result.data.data.room;
        this.floor[0].floorNum = this.block_name + " " + this.floor_name;
        this.mhq = [];
        this.bjan = [];
        this.dz = [];
        this.xfs = [];
        this.yjd = [];
        for (let i in result.data.data.object) {
          switch (result.data.data.object[i].name) {
            case "灭火器":
              this.mhq.push(result.data.data.object[i]);
              break;
            case "报警按钮":
              this.bjan.push(result.data.data.object[i]);
              break;
            case "电闸":
              this.dz.push(result.data.data.object[i]);
              break;
            case "消防栓":
              this.xfs.push(result.data.data.object[i]);
              break;
            case "应急灯":
              this.yjd.push(result.data.data.object[i]);
              break;
            default:
              break;
          }
        }
        this.object = result.data.data.object;
        mapImage = this.testMapImage;
        this.drawLine(mapImage);
      });
