    drawLine(mapImage) {
      let svgXML = `
            <svg width="1616" height="500" xmlns="http://www.w3.org/2000/svg">
                <rect x="0" y="0" width="1616" height="500" fill="rgba(255,255,255,0.5)"/>
            </svg>
